/*Table structure for table `tbl_userlogs` */

DROP TABLE IF EXISTS `tbl_userlogs`;

CREATE TABLE `tbl_userlogs` (
  `userlog_id` int(11) NOT NULL AUTO_INCREMENT,
  `ulog_title` varchar(255) DEFAULT '',
  `user_id` int(11) DEFAULT 0,
  `date_added` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`userlog_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_userlogs` */

/*Table structure for table `tbl_users` */

DROP TABLE IF EXISTS `tbl_users`;

CREATE TABLE `tbl_users` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) NOT NULL DEFAULT '',
  `lastname` varchar(255) DEFAULT '',
  `firstname` varchar(255) DEFAULT '',
  `middlename` varchar(255) DEFAULT '',
  `contactno` varchar(255) DEFAULT '',
  `emailadd` varchar(255) DEFAULT '',
  `password` text DEFAULT NULL,
  `role` int(11) DEFAULT 0 COMMENT '1=admin, 2=cashier',
  `branch_id` int(11) DEFAULT NULL,
  `photo` blob DEFAULT NULL,
  `status` int(11) DEFAULT 0,
  `date_added` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

