/*Table structure for table `tbl_walkins` */

DROP TABLE IF EXISTS `tbl_walkins`;

CREATE TABLE `tbl_walkins` (
  `walkin_id` int(11) NOT NULL AUTO_INCREMENT,
  `lastname` varchar(255) DEFAULT NULL,
  `firstname` varchar(255) DEFAULT NULL,
  `middlename` varchar(255) DEFAULT NULL,
  `extname` varchar(255) DEFAULT NULL,
  `birthdate` date DEFAULT NULL,
  `sex` varchar(255) DEFAULT NULL,
  `homeaddress` text DEFAULT NULL,
  `contactno` varchar(255) DEFAULT NULL,
  `emailaddress` varchar(255) DEFAULT NULL,
  `branch_id` int(5) DEFAULT NULL,
  `walkintype` varchar(255) DEFAULT NULL,
  `photo` blob DEFAULT NULL,
  `status` int(11) DEFAULT NULL COMMENT '1=pending; 2=active; 3=inactive',
  `date_added` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`walkin_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_walkins` */

insert  into `tbl_walkins`(`walkin_id`,`lastname`,`firstname`,`middlename`,`extname`,`birthdate`,`sex`,`homeaddress`,`contactno`,`emailaddress`,`branch_id`,`walkintype`,`photo`,`status`,`date_added`) values (1,'Ex id','Cupid','Fugia','Qui q','1996-04-17','M','Fugit','Sunt','carewyn@mailinator.com',1,'Walk-in',NULL,3,'2020-03-02 01:10:25'),(2,'Nesci','Ea fu','Assum','Quis ','1982-07-27','M','Et qu','Labor','zyritybowo@mailinator.net',1,'Walk-in',NULL,2,'2020-03-02 01:11:16'),(3,'Eveni','Volup','Facil','Sint ','1983-04-28','F','Unde ','Saepe','lefi@mailinator.net',1,'Walk-in',NULL,1,'2020-03-02 01:11:40');

